"""
    Given an integer k and a string s, find the length of the longest
    substring that contains at most k distinct characters.

    For example, given s = "abcba" and k = 2,
    the longest substring with k distinct characters is "bcb".
"""

import time

def is_in_sub(k, s, c):
    if len(s) < k:
        for i in range(len(s)):
            if s[i] == c:
                return True, s
        return True, s+c
    else:
        for i in range(len(s)):
            if s[i] == c:
                return True, s
        return False, s

def length_of_substring(k, s):
    max_len = 2
    new_char = False
    index = 0
    i = 0
    while i < len(s):
        sub = ""
        length = 0
        new_char = False
        for j in range(i, len(s)):
            in_sub, sub = is_in_sub(k, sub, s[j])
            if not new_char and s[j] != sub[0]:
                index = j
                new_char = True
            if in_sub:
                length += 1
            else:
                break
        if length > max_len:
            max_len = length
        if max_len > len(s) - i:
            break
        i = index
    return max_len

print(length_of_substring(2, "abcba"))
print(length_of_substring(2, "ababbbacba"))
print(length_of_substring(3, "ababbbacba"))
print(length_of_substring(2, "ababbbaccccccccccba"))
print(length_of_substring(3, "ababbbaccccdfaaaafccccccba"))
print(length_of_substring(4, "ababbbaccccdfaaaafccccccba"))
print(length_of_substring(5, ""))
